import React, { Component } from "react";
import "./App.css";
import MainTemplate from "./components/mainTemplate";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Switch>
            <Route exact path="/">
              <MainTemplate />
            </Route>
            <Route path="/signup"></Route>
          </Switch>
        </Router>
      </div>
    );
  }
}

export default App;
